import React from "react";
import CreateTalk from "./talkContainers/create";
import TalkList from "./talkContainers/talkList";

const CloseButton = ({ onClick, children }) => (
  <button
    className='absolute top-0 right-0 mt-2 mr-8
text-red-500 focus:text-red-500 font-bold'
    onClick={onClick}
  >
    {children}
  </button>
);

export const CreateTalkModal = ({ setOpen }) => {
  return (
    <div className=' '>
      <div className='relative   h-2/4 bg-black rounded '>
        <CloseButton onClick={() => setOpen(false)}>Close</CloseButton>
        <CreateTalk />
      </div>
    </div>
  );
};

export const TalkListModal = ({ setOpenList }) => {
  return (
    <div className=' '>
      <div className='relative   h-2/4 bg-black rounded w-full  flex flex-col '>
        <CloseButton onClick={() => setOpenList(false)}>X</CloseButton>
        <TalkList />
      </div>
    </div>
  );
};

export const PasswordModal = ({ setOpen }) => {
  return (
    <div className=' '>
      <div className='relative   h-2/4 bg-black rounded '>
        <CloseButton onClick={() => setOpen(false)}>Close</CloseButton>
        <CreateTalk />
      </div>
    </div>
  );
};
